import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Container from 'react-bootstrap/Container'
import StudentAppNavbar from "./studentapp-navbar.component";
import SubmitAnswer from "./student-submit-answer.component";
import StudentHome from "./studentapp-home.component"
import StudentCourseList from "./student-course-list.component";

export default class StudentApp extends Component {
  constructor(props) {
    super(props);
  }

  render () {
    return (
      <div>
      <Router>
        <Container>
        <StudentAppNavbar />
            <br />
              <Route path="/studentapp/submit" component = {SubmitAnswer} />
              <Route path="/studentapp/home" component = {StudentHome} />
              <Route path="/studentapp/courses" component = {StudentCourseList} />
              <Route path="/studentapp/profile" component = {StudentProfile} />
              <Route path="/student/add" component = {SubmitAnswer} />
        </Container>
      </Router>
    </div>      
    );
  }
}
